    public int lengthOfLongestSubstring(String s) {
        if (s == null || "".equals(s)) {
            return 0;
        }
        if (s.length() == 1) {
            return 1;
        }

        int max = 1;
        int start = 0;
        int end = 2;

        while (true) {
            if (end > s.length()) {
                return max;
            }
            String str = s.substring(start, end);

            char[] chars = str.toCharArray();

            for (int i = 0; i < chars.length; i++) {
                char c = str.charAt(i);
                str.indexOf(c);
            }

            Set<Character> characters = new HashSet<>();
            for (char c : chars) {
                characters.add(c);
            }
            if (characters.size() == chars.length) {
                if (str.length() > max) {
                    max = str.length();
                }
                end++;
            } else {
//                start += max;
//                start += end - 1;
                start++;
//                end = start + 2;
                end = start + str.length();
            }
        }

    }
